import React from 'react';
import {withMappable , MapTo } from '@adobe/aem-react-editable-components';

const RESOURCE_TYPE = "wknd-app/components/contenttile";

export const ContentTileConfig = {
    emptyLabel : 'Edit Content Tile',
    isEmpty:function(props){
     return !props;
    },

    resourceType : RESOURCE_TYPE
};

const contentTile = ({image, titleText, rteText, buttonLabel}) => {

    return (<div className="aem_html">{titleText}
            <hr/>
            <div dangerouslySetInnerHTML={{ __html: rteText }} />
            <hr/>



    </div>);
};

export  default contentTile;

MapTo(RESOURCE_TYPE)(contentTile,ContentTileConfig);
export const AEMContentTile = withMappable(contentTile,ContentTileConfig);
